import React, { useState } from 'react';
import './App.css';
import logo from './Pictures/logo.png';
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import axios from "axios";

const ContactPage = () => {
  // Define state for form data
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    message: ""
  });

  // Handle form input changes
  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // Handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Make POST request to your backend
    axios.post('http://localhost:4000/ContactPage', formData)
      .then(response => {
        alert('Message sent successfully!');
        console.log(response.data);
      })
      .catch(error => {
        console.error('Failed to send message:', error);
        alert('Failed to send message.');
      });

    // Optionally reset form after sending
    setFormData({
      firstName: "",
      lastName: "",
      email: "",
      message: ""
    });
  };

  return (

   <div>
       <Container>
          <nav className="navbar">
       <div className="logo">
         <img className="h-10 mr-3" style={{ width: '150px', height: '150px', padding: '5px' }} src={logo} alt="Logo" />
       </div>
       <ul className="nav-links">
         <li><a href="/valet-parking">Valet Parking</a></li>
         <li><a href="/commercial-services">Commercial Services</a></li>
         <li><a href="/locations">Locations</a></li>
         <li><a href="/careers">Careers</a></li>
         <li><a href="/about">About</a></li>
         <li><a href="/ContactPage">Contact</a></li>
       </ul>
       <button className="quote-btn" style={{ padding:'20px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black' }}>Request a Quote</a> </button>

     </nav>
     </Container>
      <Container className="contact-page">
        <Row>
          <Col>
            <div className="contact-details">
              <h2>Contact us.</h2>
              <p>info@peninsulaparking.com</p>
              <p>(800)-758-2538</p>
              <p>541 Taylor Way<br />San Carlos CA, Ca 94103</p>
              {/* Social media links here */}
            </div>
          </Col>
          <Col>
            <div className="contact-form">
              <Form onSubmit={handleSubmit}>
                <Form.Group>
                  <Form.Label>First Name (required)</Form.Label>
                  <Form.Control type="text" name="firstName" value={formData.firstName} onChange={handleChange} required />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Last Name</Form.Label>
                  <Form.Control type="text" name="lastName" value={formData.lastName} onChange={handleChange} />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Email (required)</Form.Label>
                  <Form.Control type="email" name="email" value={formData.email} onChange={handleChange} required />
                </Form.Group>
                <Form.Group>
                  <Form.Label>Message (required)</Form.Label>
                  <Form.Control as="textarea" name="message" value={formData.message} onChange={handleChange} required />
                </Form.Group>
                <Button type="submit">Send</Button>
              </Form>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default ContactPage;
